Dinosaurs: Giants of Patagonia (Sky High)

Science Documentary hosted by Donald Sutherland, published by Sky High Entertainment in 2007 - English narration


Information
------------------------------

A film about life in the Early Cretaceous, Patagonia. It features paleontologist Rodolfo Coria and his work, with Donald Sutherland acting as main narrator.
If it weren't for a series of cataclysmic events, a comet impact being first on the list, our planet could well still be the domain of dinosaurs. We visit sites of major discoveries he has contributed to in Patagonia and travel back in time to see these amazing beasts come to life in 3D. Patagonia has given us the largest living animal to ever walk the Earth: the titanesque plant-eating Argentinosaur, and its nemesis, the Giganotosaur, a bipedal carnivore that could easily challenge the famous T-Rex.

